import './App.css';
import Services from './Services';

function App() {

    let serviceData = [
        {
            image: "https://www.google.com/url?sa=i&url=https%3A%2F%2Fwww.pexels.com%2Fsearch%2Fbackground%2520image%2F&psig=AOvVaw2ZiOx0WV37IIteJaW1fiFK&ust=1629570888562000&source=images&cd=vfe&ved=0CAsQjRxqFwoTCMj97OGewPICFQAAAAAdAAAAABAI",
            title: "First Heading",
            subtitle: "First Heading sub title",
            description: "In publishing and graphic design, Lorem ipsum is a placeholder text commonly used to demonstrate the visual form of a document or a typeface without relying on meaningful content."
        }
    ]

    return (
        <div className="App">

            <h1 style={{marginLeft:"15%"}}>All Services</h1>
            <div className="container">
                {
                    serviceData.map((service,index)=>(

                        <Services key={index} title={service.title} subtitle={service.subtitle} description={service.description} image={service.image} />

                    ))
                }
            </div>
        </div>
    );
}

export default App;
